window.bookSummaryJSON = "<p>The deadliest game is the one you never chose to play.</p> <p>Finding out Ares, the god of war, is my father was a shock.</p> <p>Finding out I'm destined to lead his troops out of the aether and overthrow Cronus himself?</p> <p>Let's just say I'm gonna need more than chamomile tea to power through this.</p> <p>Hades, Loki, and Fenrir are the last three people I'd want to be stranded with, but the only way we're getting out of this hellscape is by working together.</p> <p>If they think I'm going to forget all their wicked games just because we have a common goal, they're dead wrong.</p> <p>The Queen is taking her throne back, and these three gorgeous jerks are going to have to grovel if they want forgiveness.</p>"; 
